prompt --application/shared_components/plugins/item_type/com_stefan_dobre_javascript_code_editor
begin
wwv_flow_api.create_plugin(
 p_id=>wwv_flow_api.id(6251714908118123736)
,p_plugin_type=>'ITEM TYPE'
,p_name=>'COM.STEFAN_DOBRE.JAVASCRIPT_CODE_EDITOR'
,p_display_name=>'JavaScript Code Editor'
,p_supported_ui_types=>'DESKTOP:JQM_SMARTPHONE'
,p_supported_component_types=>'APEX_APPLICATION_PAGE_ITEMS:APEX_APPL_PAGE_IG_COLUMNS'
,p_image_prefix => nvl(wwv_flow_application_install.get_static_plugin_file_prefix('ITEM TYPE','COM.STEFAN_DOBRE.JAVASCRIPT_CODE_EDITOR'),'')
,p_javascript_file_urls=>wwv_flow_string.join(wwv_flow_t_varchar2(
'#PLUGIN_FILES#js/script.js',
'#PLUGIN_FILES#js/codemirror-custom.min.js'))
,p_css_file_urls=>wwv_flow_string.join(wwv_flow_t_varchar2(
'#PLUGIN_FILES#css/style.css',
'#PLUGIN_FILES#css/codemirror-custom.min.css'))
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'procedure render',
'    ( p_item   in            apex_plugin.t_item',
'    , p_plugin in            apex_plugin.t_plugin',
'    , p_param  in            apex_plugin.t_item_render_param',
'    , p_result in out nocopy apex_plugin.t_item_render_result',
'    )',
'as',
'    l_item_name  varchar2(32767) := p_item.name;',
'    l_code       varchar2(32767) := p_item.attribute_01;',
'    l_editable   boolean         := (p_item.attribute_02 = ''Y'');',
'    ',
'    l_item_name_esc varchar2(32767) := apex_escape.html_attribute(l_item_name);',
'    l_code_esc      varchar2(32767) := apex_escape.html(l_code);',
'    ',
'begin',
'',
'    if apex_application.g_debug then',
'        apex_plugin_util.debug_page_item',
'            ( p_page_item  => p_item',
'            , p_plugin     => p_plugin',
'            );',
'    end if;',
'',
'    sys.htp.p(''<div>'');',
'    sys.htp.prn(''<code id="''|| l_item_name_esc ||''" class="cm-code">'');',
'    sys.htp.prn(l_code_esc);',
'    sys.htp.prn(''</code>'');',
